import React, {Component} from 'react';

class Item extends Component {

    render() {
        let{id, userName,time,comments,content,likes,location,pics}= this.props;
        return (
            <div>
              <div>
                  <div>{userName}</div>
                  <div>time</div>
              </div>
                <div><p>{content}</p>
                <div>pics.map((item)=>{
                    <img src={item.url} alt="pic"/>
                })</div></div>
            </div>
        );
    }
}

export default Item;
